import React, { Component } from 'react';
import AppFooter from '../common/AppFooter';
import AppHeader from '../common/AppHeader';
import {Container} from 'reactstrap';
class Stream extends Component {
    render() {
        return (
            <div >
                             <div> <AppHeader /></div>   
<div style={{ margin: 'auto', textAlign: 'center' }}> <h1 >Konsul Rabu</h1></div>


                <hr/>
                <Container style={{ textAlign: 'center' }}>
                <p>Konsul Rabu merupakan media sharing ilmu dari ahli-ahli maupun tamu dari Monggovest dalam bentuk Live Stream.
                    yang dilaksanakan tiap hari rabu. 
                    <br/>
                    Anda dapat memberikan pertanyaan secara langsung dengan mengirim pesan ke whatsapp kami di nomor 082291875122.
                </p>
                </Container>
          {/* eslint-disable-next-line */}
                <iframe
    src="https://player.twitch.tv/?channel=naufalrasyid&muted=true"
    height="720"
    width="1280"
    frameborder="0"
    scrolling="no"
    allowfullscreen="true">
</iframe>
<AppFooter />

            </div>
        );
    }
}

export default Stream;
